import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Grid from '@material-ui/core/Grid';
import Checkbox from "@material-ui/core/Checkbox";

const products = [
  { name: 'Product 1', desc: 'A nice thing', price: '$9.99' },
  { name: 'Product 2', desc: 'Another thing', price: '$3.45' },
  { name: 'Product 3', desc: 'Something else', price: '$6.51' },
  { name: 'Product 4', desc: 'Best thing of all', price: '$14.11' },
  { name: 'Shipping', desc: '', price: 'Free' },
];
const addresses = ['1 Material-UI Drive', 'Reactville', 'Anytown', '99999', 'USA'];
const payments = [
  { name: 'Card type', detail: 'Visa' },
  { name: 'Card holder', detail: 'Mr John Smith' },
  { name: 'Card number', detail: 'xxxx-xxxx-xxxx-1234' },
  { name: 'Expiry date', detail: '04/2024' },
];

const useStyles = makeStyles((theme) => ({
  listItem: {
    padding: theme.spacing(1, 0),
  },
  total: {
    fontWeight: 700,
  },
  title: {
    marginTop: theme.spacing(2),
  },
}));

export default function TrainForm() {
  const classes = useStyles();

  return (
    <React.Fragment>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <div style={{}}>
            <label style={{fontWeight:'bold'}}>Have you received any support from NBSSI?</label>
            <Checkbox
                checked={support}
                onChange={(e)=>setSupport(e.target.checked)}
                color="primary"
                inputProps={{ 'aria-label': 'secondary checkbox' }}
            />yes

            <Checkbox
                checked={!support ? true : false}
                onChange={event => setCheckTin(!event.target.checked)}
                color="primary"
                inputProps={{ 'aria-label': 'secondary checkbox' }}
            />No
          </div>
        </Grid>
        {
          !support ?
              <Grid item xs={12}>
                <div style={{}}>
                  <label style={{fontWeight:'bold'}}>Would you want to receive support from NBSSI?</label>
                  <Checkbox
                      checked={needsupport}
                      onChange={(e)=>setNeedSupport(e.target.checked)}
                      color="primary"
                      inputProps={{ 'aria-label': 'secondary checkbox' }}
                  />yes

                  <Checkbox
                      checked={!needsupport ? true : false}
                      onChange={event => setCheckTin(!event.target.checked)}
                      color="primary"
                      inputProps={{ 'aria-label': 'secondary checkbox' }}
                  />No
                </div>
              </Grid> : <p> </p>
        }
      </Grid>
    </React.Fragment>
  );
}
